import React, { useState } from "react";

import Box from "@material-ui/core/Box";
import Button from "@material-ui/core/Button";
import Typography from "@material-ui/core/Typography";
import AFastTable from "./aFastTable";
import ATextField from "./aTextField";
import { makeStyles } from "@material-ui/core/styles";
import NavigateBeforeIcon from "@material-ui/icons/NavigateBefore";
import NavigateNextIcon from "@material-ui/icons/NavigateNext";

const useStyles = makeStyles((theme) => ({
  pageButtons: {
    backgroundColor: theme.palette.secondary.contrastText,
    minWidth: "30px",
    maxWidth: "30px",
    minHeight: "30px",
    maxHeight: "30px",
    margin: "20px 5px 10px 5px",
  },
  currentPageButton: {
    minWidth: "30px",
    maxWidth: "30px",
    minHeight: "30px",
    maxHeight: "30px",
    margin: "20px 5px 10px 5px",
  },
}));
const TestContentPanel3 = (props) => {
  const classes = useStyles();
  const columnDefs = [
    {
      headerName: "ID",
      field: "id",
      sortable: true,
      sortOrder: "asc",
      filter: true,
      checkbox: true,
    },
    { headerName: "Make", field: "make", sortable: true, sortOrder: "desc" },
    { headerName: "Model", field: "model", filter: true },
    { headerName: "Price", field: "price", radio: true },
  ];

  const rowData = [
    { id: 1111, make: "Mock Data", model: "From Prop", price: 1111111 },
    { id: 1231, make: "Toyota", model: "Celica", price: 35000 },
    { id: 1232, make: "Ford", model: " Mondeo", price: 32000 },
    { id: 1233, make: "Porsche", model: "Boxter", price: 35000 },
    { id: 1234, make: "Mercedes Benz", model: "S Class", price: 80000 },
  ];
  return (
    <Box style={{ margin: "20px" }}>
      <ATextField name="search" />{" "}
      <Button variant="contained" color="primary">
        Search
      </Button>
      <Box style={{ height: "20px" }} />
      <AFastTable
        columnDefs={columnDefs}
        rowData={rowData}
        rowSelection="multiple"
      />
      <Button
        disabled
        className={classes.pageButtons}
        variant="outlined"
        color="primary"
      >
        <NavigateBeforeIcon />
      </Button>
      <Button
        className={classes.pageButtons}
        variant="outlined"
        color="primary"
      >
        1
      </Button>
      <Button
        className={classes.pageButtons}
        variant="outlined"
        color="primary"
      >
        2
      </Button>
      <Button
        className={classes.pageButtons}
        variant="outlined"
        color="primary"
      >
        3
      </Button>
      <Button
        className={classes.currentPageButton}
        variant="contained"
        color="primary"
      >
        4
      </Button>
      <Button
        className={classes.pageButtons}
        variant="outlined"
        color="primary"
      >
        5
      </Button>
      <Button
        className={classes.pageButtons}
        variant="outlined"
        color="primary"
      >
        6
      </Button>
      <Button
        className={classes.pageButtons}
        variant="outlined"
        color="primary"
      >
        7
      </Button>
      <Button
        className={classes.pageButtons}
        variant="outlined"
        color="primary"
      >
        8
      </Button>
      <Button
        className={classes.pageButtons}
        variant="outlined"
        color="primary"
      >
        9
      </Button>
      <Button
        className={classes.pageButtons}
        variant="outlined"
        color="primary"
      >
        <NavigateNextIcon />
      </Button>
    </Box>
  );
};
export default TestContentPanel3;
